De moesson (naar het Engels monsoon dat zowel een verbastering is van het Arabische mausim: seizoen, als het Portugese mauçam, de letterlijke oorsprong van monsoon) is de periodieke wind in tropische gebieden die een halfjaar lang uit een bepaalde richting waait om dan ongeveer 180° van richting te veranderen. Deze overgang tussen deze moessons is de kentering. De windrichting wordt gebruikt in de aanduiding van de moesson, bijvoorbeeld zuidwest-moesson of noordoost-moesson. Door de verandering van windrichting wordt er ook een andere luchtsoort aangevoerd, waardoor het weerbeeld sterk verandert. Daarom wordt ook wel gesproken van de natte moesson en de droge moesson. De bekendste moesson is die van India en omstreken. Tot begin juni is het noorden van India droog, maar in juni, juli en augustus valt er net zoveel regen als tijdens een volledig jaar in West-Europese landen. Daarna blijft het weer droog tot in juni de volgende moesson aanbreekt. In zuidelijk Afrika, Indonesië en op de Antillen valt de regentijd samen met de Europese winter. Er zijn verschillende moessongebieden te onderscheiden: 
* Zuid-Azië en het noordelijk deel van de Indische Oceaan; 
* Oost-Azië, Zuidoost-Azië, de Oost-Chinese en Zuid-Chinese Zee; 
* Indonesië bezuiden de evenaar, Noord-Australië en het zuidwestelijke deel van de Grote Oceaan; 
* het kustgebied van West-Afrika tussen 5°N en 20°N; 
* de westkust van Midden-Amerika. De moesson-effecten zijn het duidelijkst te onderscheiden in het eerste gebied. Dit komt door de grote landmassa van Azië en doordat de Himalaya het Indisch subcontinent afsluit van de koude lucht van hogere breedten.
